contracts/BankApproval.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract BankApproval {
    struct Approval {
        string bankId;
        bytes signature;
        uint256 timestamp;
    }

    mapping(string => Approval[]) public approvals;
    mapping(string => mapping(string => bool)) public hasBankApproved; // txId -> bankId -> bool

    event BankApproved(string indexed transactionId, string bankId);

    function recordApproval(string memory _transactionId, string memory _bankId, bytes memory _signature) external {
        require(!hasBankApproved[_transactionId][_bankId], "Bank already approved");

        approvals[_transactionId].push(Approval(_bankId, _signature, block.timestamp));
        hasBankApproved[_transactionId][_bankId] = true;

        emit BankApproved(_transactionId, _bankId);
    }

    function getApprovalCount(string memory _transactionId) external view returns (uint256) {
        return approvals[_transactionId].length;
    }
}

contracts/NodeRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract NodeRegistry {
    struct Node {
        address walletAddress;
        string url;
        bool isActive;
        string name;
    }

    mapping(address => Node) public nodes;
    address[] public nodeAddresses;
    address public admin;

    event NodeRegistered(address indexed nodeAddress, string name);
    event NodeStatusChanged(address indexed nodeAddress, bool isActive);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin");
        _;
    }

    function registerNode(address _nodeAddress, string memory _name, string memory _url) external onlyAdmin {
        require(nodes[_nodeAddress].walletAddress == address(0), "Node already registered");
        nodes[_nodeAddress] = Node(_nodeAddress, _url, true, _name);
        nodeAddresses.push(_nodeAddress);
        emit NodeRegistered(_nodeAddress, _name);
    }

    function setNodeStatus(address _nodeAddress, bool _isActive) external onlyAdmin {
        require(nodes[_nodeAddress].walletAddress != address(0), "Node not found");
        nodes[_nodeAddress].isActive = _isActive;
        emit NodeStatusChanged(_nodeAddress, _isActive);
    }

    function getActiveNodeCount() external view returns (uint256) {
        uint256 count = 0;
        for (uint256 i = 0; i < nodeAddresses.length; i++) {
            if (nodes[nodeAddresses[i]].isActive) {
                count++;
            }
        }
        return count;
    }

    function isNodeActive(address _node) external view returns (bool) {
        return nodes[_node].isActive;
    }
}

contracts/TransactionStore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract TransactionStore {
    enum Status { PENDING, APPROVED, REJECTED }

    struct Transaction {
        string id;
        string sender;
        uint256 amount;
        Status status;
        uint256 timestamp;
    }

    mapping(string => Transaction) public transactions;
    string[] public transactionIds;

    event TransactionFinalized(string indexed transactionId, Status status);

    function createTransaction(string memory _id, string memory _sender, uint256 _amount) external {
        require(transactions[_id].timestamp == 0, "Transaction exists");
        transactions[_id] = Transaction(_id, _sender, _amount, Status.PENDING, block.timestamp);
        transactionIds.push(_id);
    }

    function finalizeTransaction(string memory _id, bool _approved) external {
        require(transactions[_id].timestamp != 0, "Transaction not found");
        require(transactions[_id].status == Status.PENDING, "Already finalized");

        transactions[_id].status = _approved ? Status.APPROVED : Status.REJECTED;
        emit TransactionFinalized(_id, transactions[_id].status);
    }

    function getTransaction(string memory _id) external view returns (Transaction memory) {
        return transactions[_id];
    }
}

contracts/VoteManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./NodeRegistry.sol";

contract VoteManager {
    NodeRegistry public nodeRegistry;

    struct Vote {
        address voter;
        bool decision; // true = approve, false = reject
        uint256 timestamp;
    }

    // transactionId => votes
    mapping(string => Vote[]) public transactionVotes;
    // transactionId => voter => hasVoted
    mapping(string => mapping(address => bool)) public hasVoted;

    event VoteCast(string indexed transactionId, address indexed voter, bool decision);

    constructor(address _nodeRegistry) {
        nodeRegistry = NodeRegistry(_nodeRegistry);
    }

    function castVote(string memory _transactionId, bool _decision) external {
        require(nodeRegistry.isNodeActive(msg.sender), "Not an active node");
        require(!hasVoted[_transactionId][msg.sender], "Already voted");

        transactionVotes[_transactionId].push(Vote(msg.sender, _decision, block.timestamp));
        hasVoted[_transactionId][msg.sender] = true;

        emit VoteCast(_transactionId, msg.sender, _decision);
    }

    function getVoteCount(string memory _transactionId) external view returns (uint256 yes, uint256 no) {
        Vote[] memory votes = transactionVotes[_transactionId];
        for (uint256 i = 0; i < votes.length; i++) {
            if (votes[i].decision) {
                yes++;
            } else {
                no++;
            }
        }
    }
}

